import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
  box-shadow: 0px 2px 1px -1px rgba(0, 0, 0, 0.2), 0px 1px 1px 0px rgba(0, 0, 0, 0.14), 0px 1px 3px 0px rgba(0,0,0,.12);
  padding: 20px;
  border-radius: 3px;
`

export const Card = () => {

  return (
    <Container>
      Here's my card!
    </Container>
  )
}
